import "./modal.css";
import { Button, Modal } from "react-bootstrap"

const ModalOne = (props) => {

    return (

        <div className="static-modal">
            <Modal.Dialog>
                <Modal.Header>
                    <Modal.Title>Welcome</Modal.Title>
                </Modal.Header>

                <Modal.Body>

                    {props.children}

                </Modal.Body>

                {/* <Modal.Footer>
    <Button onClick={this.handleClose}>Close</Button>
</Modal.Footer> */}
            </Modal.Dialog>
        </div>


    )

}

export default ModalOne;

